sys_variable_value.value:
(function execute(inputs, outputs) {
    var utils = new GoogleDirectoryUtils();
    inputs = utils.trimStringInputs(inputs);
    if (utils.isEmpty(inputs.group_key))
        throw new Error("Group key cannot be empty");
    if (utils.isEmpty(inputs.member_key))
        throw new Error("Member key connot be empty");

    outputs.group_key = inputs.group_key;
    outputs.member_key = inputs.member_key;
})(inputs, outputs);

